The Sweetest Gift is a Christmas album by country singer Trisha Yearwood and is her fourth album overall. Yearwood sings a mixture of familiar traditional and popular material, along with more recent compositions such as &quot;It Wasn't His Child&quot; and &quot;There's a New Kid in Town&quot;. Two of its tracks managed to achieve positions near the lower end of the Billboard Hot Country Singles chart: &quot;It Wasn't His Child&quot; peaked at #60, and &quot;Reindeer Boogie&quot; at #63. The album rose to the #17 position in the Country Albums chart. A re-release of the album in 1998 has a different album cover.

Yearwood covers a series of Christmas standards in a country music format. The album was a given a positive review by allmusic.com, receiving 4 out of 5 stars.

Patricia Lynn Yearwood, professionally known as Trisha Yearwood (born September 19, 1964) is an American country music artist. She is best known for her ballads about vulnerable young women from a female perspective that have been described by some music critics as &quot;strong&quot; and &quot;confident.&quot;

Originally discovered by Garth Brooks in the late 1980s, Trisha Yearwood signed with MCA Records in 1990. She came to prominence with her debut single, &quot;She's in Love with the Boy&quot; which became a #1 hit on the Hot Country Singles &amp; Tracks chart in 1991. Her second album release, Hearts in Armor (1992) reflected Yearwood's own personal issues, which won her widespread critical acclaim among music critics and further success in country music. Her later album releases such as, The Song Remembers When (1993), Thinkin' About You (1995), and Everybody Knows (1996) also demonstrated her creative control, featuring collaborations from Rodney Crowell, Willie Nelson, and Garth Brooks.

Yearwood also found major success in country radio during much of the 1990s, including with the 1997 song &quot;How Do I Live.&quot; Initially released on the soundtrack of the film, Con Air, the song was also issued on her &quot;greatest hits&quot; compilation entitled (Songbook) A Collection of Hits (1997) and would eventually win Best Female Country Vocal Performance from the Grammy Awards. In addition she would also win accolades from the Academy of Country Music and Country Music Association Awards in 1997 and 1998. Aside from her success in country music, she has also donated her time as a philanthropist, working with Habitat for Humanity and the Make a Wish Foundation. In addition she also set aside a project to release her first cookbook in April 2008 titled Georgia Cooking in an Oklahoma Kitchen, which consisted of southern cooking recipes from Yearwood, her mother, and sister.


